import React from "react";
import { Link } from "react-router-dom";
import "../components/Styles/ProfessionalDashboard.css"; // You can add custom styling for your dashboard here

function ProfessionalDashboard() {
  return (
    <div className="dashboard-container">
      <h1>Professional Dashboard</h1>

      {/* Navigation links for different sections */}
      <div className="dashboard-links">
        <Link to="/manage-boardings">
          <button className="btn">Manage Boardings</button>
        </Link>
        <Link to="/view-reports">
          <button className="btn">View Reports</button>
        </Link>
        <Link to="/settings">
          <button className="btn">Settings</button>
        </Link>
        <Link to="/logout">
          <button className="btn">Logout</button>
        </Link>
      </div>

      {/* Dashboard content area */}
      <div className="dashboard-content">
        <h2>Welcome to your dashboard</h2>
        <p>This is where you can manage your boardings, view reports, and access settings.</p>
      </div>
    </div>
  );
}

export default ProfessionalDashboard;
